def compile(self, optimizer, loss=None, metrics=None, loss_weights=None, sample_weight_mode=None, weighted_metrics=None, target_tensors=None, **kwargs):
    """Configures the model for training.

    # Arguments
        optimizer: String (name of optimizer) or optimizer instance.
            See [optimizers](/optimizers).
        loss: String (name of objective function) or objective function.
            See [losses](/losses).
            If the model has multiple outputs, you can use a different loss
            on each output by passing a dictionary or a list of losses.
            The loss value that will be minimized by the model
            will then be the sum of all individual losses.
        metrics: List of metrics to be evaluated by the model
            during training and testing.
            Typically you will use `metrics=['accuracy']`.
            To specify different metrics for different outputs of a
            multi-output model, you could also pass a dictionary,
            such as `metrics={'output_a': 'accuracy'}`.
        loss_weights: Optional list or dictionary specifying scalar
            coefficients (Python floats) to weight the loss contributions
            of different model outputs.
            The loss value that will be minimized by the model
            will then be the *weighted sum* of all individual losses,
            weighted by the `loss_weights` coefficients.
            If a list, it is expected to have a 1:1 mapping
            to the model's outputs. If a tensor, it is expected to map
            output names (strings) to scalar coefficients.
        sample_weight_mode: If you need to do timestep-wise
            sample weighting (2D weights), set this to `"temporal"`.
            `None` defaults to sample-wise weights (1D).
            If the model has multiple outputs, you can use a different
            `sample_weight_mode` on each output by passing a
            dictionary or a list of modes.
        weighted_metrics: List of metrics to be evaluated and weighted
            by sample_weight or class_weight during training and testing.
        target_tensors: By default, Keras will create placeholders for the
            model's target, which will be fed with the target data during
            training. If instead you would like to use your own
            target tensors (in turn, Keras will not expect external
            Numpy data for these targets at training time), you
            can specify them via the `target_tensors` argument. It can be
            a single tensor (for a single-output model), a list of tensors,
            or a dict mapping output names to target tensors.
        **kwargs: When using the Theano/CNTK backends, these arguments
            are passed into `K.function`.
            When using the TensorFlow backend,
            these arguments are passed into `tf.Session.run`.

    # Raises
        ValueError: In case of invalid arguments for
            `optimizer`, `loss`, `metrics` or `sample_weight_mode`.
    """
    loss = loss or {}
    self.optimizer = optimizers.get(optimizer)
    self.loss = loss
    self.loss_weights = loss_weights
    self.sample_weight_mode = sample_weight_mode
    if isinstance(loss, dict):
        for name in loss:
            if name not in self.output_names:
                raise ValueError('Unknown entry in loss dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
        loss_functions = []
        for name in self.output_names:
            if name not in loss:
                warnings.warn('Output "' + name + '" missing from loss dictionary. We assume this was done on purpose, and we will not be expecting any data to be passed to "' + name + '" during training.', stacklevel=2)
            loss_functions.append(losses.get(loss.get(name)))
    elif isinstance(loss, list):
        if len(loss) != len(self.outputs):
            raise ValueError('When passing a list as loss, it should have one entry per model outputs. The model has ' + str(len(self.outputs)) + ' outputs, but you passed loss=' + str(loss))
        loss_functions = [losses.get(l) for l in loss]
    else:
        loss_function = losses.get(loss)
        loss_functions = [loss_function for _ in range(len(self.outputs))]
    self.loss_functions = loss_functions
    weighted_losses = [_weighted_masked_objective(fn) for fn in loss_functions]
    skip_target_indices = []
    skip_target_weighing_indices = []
    self._feed_outputs = []
    self._feed_output_names = []
    self._feed_output_shapes = []
    self._feed_loss_fns = []
    for i in range(len(weighted_losses)):
        if weighted_losses[i] is None:
            skip_target_indices.append(i)
            skip_target_weighing_indices.append(i)
    masks = self.compute_mask(self.inputs, mask=None)
    if masks is None:
        masks = [None for _ in self.outputs]
    if not isinstance(masks, list):
        masks = [masks]
    if loss_weights is None:
        loss_weights_list = [1.0 for _ in range(len(self.outputs))]
    elif isinstance(loss_weights, dict):
        for name in loss_weights:
            if name not in self.output_names:
                raise ValueError('Unknown entry in loss_weights dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
        loss_weights_list = []
        for name in self.output_names:
            loss_weights_list.append(loss_weights.get(name, 1.0))
    elif isinstance(loss_weights, list):
        if len(loss_weights) != len(self.outputs):
            raise ValueError('When passing a list as loss_weights, it should have one entry per model output. The model has ' + str(len(self.outputs)) + ' outputs, but you passed loss_weights=' + str(loss_weights))
        loss_weights_list = loss_weights
    else:
        raise TypeError('Could not interpret loss_weights argument: ' + str(loss_weights) + ' - expected a list of dicts.')
    self.targets = []
    self._feed_targets = []
    if target_tensors is not None:
        if isinstance(target_tensors, list):
            if len(target_tensors) != len(self.outputs):
                raise ValueError('When passing a list as `target_tensors`, it should have one entry per model output. The model has ' + str(len(self.outputs)) + ' outputs, but you passed target_tensors=' + str(target_tensors))
        elif isinstance(target_tensors, dict):
            for name in target_tensors:
                if name not in self.output_names:
                    raise ValueError('Unknown entry in `target_tensors` dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
            tmp_target_tensors = []
            for name in self.output_names:
                tmp_target_tensors.append(target_tensors.get(name, None))
            target_tensors = tmp_target_tensors
        else:
            raise TypeError('Expected `target_tensors` to be a list or dict, but got:', target_tensors)
    for i in range(len(self.outputs)):
        if i in skip_target_indices:
            self.targets.append(None)
        else:
            shape = self._internal_output_shapes[i]
            name = self.output_names[i]
            if target_tensors is not None:
                target = target_tensors[i]
            else:
                target = None
            if target is None or K.is_placeholder(target):
                if target is None:
                    target = K.placeholder(ndim=len(shape), name=name + '_target', sparse=K.is_sparse(self.outputs[i]), dtype=K.dtype(self.outputs[i]))
                self._feed_targets.append(target)
                self._feed_outputs.append(self.outputs[i])
                self._feed_output_names.append(name)
                self._feed_output_shapes.append(shape)
                self._feed_loss_fns.append(self.loss_functions[i])
            else:
                skip_target_weighing_indices.append(i)
            self.targets.append(target)
    sample_weights = []
    sample_weight_modes = []
    if isinstance(sample_weight_mode, dict):
        for name in sample_weight_mode:
            if name not in self.output_names:
                raise ValueError('Unknown entry in sample_weight_mode dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
        for i, name in enumerate(self.output_names):
            if i in skip_target_weighing_indices:
                weight = None
                sample_weight_modes.append(None)
            else:
                if name not in sample_weight_mode:
                    raise ValueError('Output "' + name + '" missing from sample_weight_modes dictionary')
                if sample_weight_mode.get(name) == 'temporal':
                    weight = K.placeholder(ndim=2, name=name + '_sample_weights')
                    sample_weight_modes.append('temporal')
                else:
                    weight = K.placeholder(ndim=1, name=name + '_sample_weights')
                    sample_weight_modes.append(None)
            sample_weights.append(weight)
    elif isinstance(sample_weight_mode, list):
        if len(sample_weight_mode) != len(self.outputs):
            raise ValueError('When passing a list as sample_weight_mode, it should have one entry per model output. The model has ' + str(len(self.outputs)) + ' outputs, but you passed sample_weight_mode=' + str(sample_weight_mode))
        for i in range(len(self.output_names)):
            if i in skip_target_weighing_indices:
                weight = None
                sample_weight_modes.append(None)
            else:
                mode = sample_weight_mode[i]
                name = self.output_names[i]
                if mode == 'temporal':
                    weight = K.placeholder(ndim=2, name=name + '_sample_weights')
                    sample_weight_modes.append('temporal')
                else:
                    weight = K.placeholder(ndim=1, name=name + '_sample_weights')
                    sample_weight_modes.append(None)
            sample_weights.append(weight)
    else:
        for i, name in enumerate(self.output_names):
            if i in skip_target_weighing_indices:
                sample_weight_modes.append(None)
                sample_weights.append(None)
            elif sample_weight_mode == 'temporal':
                sample_weights.append(K.placeholder(ndim=2, name=name + '_sample_weights'))
                sample_weight_modes.append('temporal')
            else:
                sample_weights.append(K.placeholder(ndim=1, name=name + '_sample_weights'))
                sample_weight_modes.append(None)
    self.sample_weight_modes = sample_weight_modes
    self._feed_sample_weight_modes = []
    for i in range(len(self.outputs)):
        if i not in skip_target_weighing_indices:
            self._feed_sample_weight_modes.append(self.sample_weight_modes[i])
    self.metrics = metrics or []
    self.weighted_metrics = weighted_metrics
    self.metrics_names = ['loss']
    self.metrics_tensors = []
    total_loss = None
    with K.name_scope('loss'):
        for i in range(len(self.outputs)):
            if i in skip_target_indices:
                continue
            y_true = self.targets[i]
            y_pred = self.outputs[i]
            weighted_loss = weighted_losses[i]
            sample_weight = sample_weights[i]
            mask = masks[i]
            loss_weight = loss_weights_list[i]
            with K.name_scope(self.output_names[i] + '_loss'):
                output_loss = weighted_loss(y_true, y_pred, sample_weight, mask)
            if len(self.outputs) > 1:
                self.metrics_tensors.append(output_loss)
                self.metrics_names.append(self.output_names[i] + '_loss')
            if total_loss is None:
                total_loss = loss_weight * output_loss
            else:
                total_loss += loss_weight * output_loss
        if total_loss is None:
            if not self.losses:
                raise ValueError('The model cannot be compiled because it has no loss to optimize.')
            else:
                total_loss = 0.0
        for loss_tensor in self.losses:
            total_loss += loss_tensor
    nested_metrics = _collect_metrics(metrics, self.output_names)
    nested_weighted_metrics = _collect_metrics(weighted_metrics, self.output_names)
    self.metrics_updates = []
    self.stateful_metric_names = []
    with K.name_scope('metrics'):
        for i in range(len(self.outputs)):
            if i in skip_target_indices:
                continue
            y_true = self.targets[i]
            y_pred = self.outputs[i]
            weights = sample_weights[i]
            output_metrics = nested_metrics[i]
            output_weighted_metrics = nested_weighted_metrics[i]

            def handle_metrics(metrics, weights=None):
                metric_name_prefix = 'weighted_' if weights is not None else ''
                for metric in metrics:
                    if metric in ('accuracy', 'acc', 'crossentropy', 'ce'):
                        output_shape = self._internal_output_shapes[i]
                        if output_shape[-1] == 1 or self.loss_functions[i] == losses.binary_crossentropy:
                            if metric in ('accuracy', 'acc'):
                                metric_fn = metrics_module.binary_accuracy
                            elif metric in ('crossentropy', 'ce'):
                                metric_fn = metrics_module.binary_crossentropy
                        elif self.loss_functions[i] == losses.sparse_categorical_crossentropy:
                            if metric in ('accuracy', 'acc'):
                                metric_fn = metrics_module.sparse_categorical_accuracy
                            elif metric in ('crossentropy', 'ce'):
                                metric_fn = metrics_module.sparse_categorical_crossentropy
                        elif metric in ('accuracy', 'acc'):
                            metric_fn = metrics_module.categorical_accuracy
                        elif metric in ('crossentropy', 'ce'):
                            metric_fn = metrics_module.categorical_crossentropy
                        if metric in ('accuracy', 'acc'):
                            suffix = 'acc'
                        elif metric in ('crossentropy', 'ce'):
                            suffix = 'ce'
                        weighted_metric_fn = _weighted_masked_objective(metric_fn)
                        metric_name = metric_name_prefix + suffix
                    else:
                        metric_fn = metrics_module.get(metric)
                        weighted_metric_fn = _weighted_masked_objective(metric_fn)
                        if hasattr(metric_fn, 'name'):
                            metric_name = metric_fn.name
                        else:
                            metric_name = metric_fn.__name__
                        metric_name = metric_name_prefix + metric_name
                    with K.name_scope(metric_name):
                        metric_result = weighted_metric_fn(y_true, y_pred, weights=weights, mask=masks[i])
                    if len(self.output_names) > 1:
                        metric_name = self.output_names[i] + '_' + metric_name
                    j = 1
                    base_metric_name = metric_name
                    while metric_name in self.metrics_names:
                        metric_name = base_metric_name + '_' + str(j)
                        j += 1
                    self.metrics_names.append(metric_name)
                    self.metrics_tensors.append(metric_result)
                    if isinstance(metric_fn, Layer) and metric_fn.stateful:
                        self.stateful_metric_names.append(metric_name)
                        self.metrics_updates += metric_fn.updates
            handle_metrics(output_metrics)
            handle_metrics(output_weighted_metrics, weights=weights)
    self.total_loss = total_loss
    self.sample_weights = sample_weights
    self._feed_sample_weights = []
    for i in range(len(self.sample_weights)):
        if i not in skip_target_weighing_indices:
            self._feed_sample_weights.append(sample_weights[i])
    self._function_kwargs = kwargs
    self.train_function = None
    self.test_function = None
    self.predict_function = None
    trainable_weights = self.trainable_weights
    self._collected_trainable_weights = trainable_weights

def _make_train_function(self):
    if not hasattr(self, 'train_function'):
        raise RuntimeError('You must compile your model before using it.')
    self._check_trainable_weights_consistency()
    if self.train_function is None:
        inputs = self._feed_inputs + self._feed_targets + self._feed_sample_weights
        if self.uses_learning_phase and (not isinstance(K.learning_phase(), int)):
            inputs += [K.learning_phase()]
        with K.name_scope('training'):
            with K.name_scope(self.optimizer.__class__.__name__):
                training_updates = self.optimizer.get_updates(params=self._collected_trainable_weights, loss=self.total_loss)
            updates = self.updates + training_updates + self.metrics_updates
            self.train_function = K.function(inputs, [self.total_loss] + self.metrics_tensors, updates=updates, name='train_function', **self._function_kwargs)

def _make_test_function(self):
    if not hasattr(self, 'test_function'):
        raise RuntimeError('You must compile your model before using it.')
    if self.test_function is None:
        inputs = self._feed_inputs + self._feed_targets + self._feed_sample_weights
        if self.uses_learning_phase and (not isinstance(K.learning_phase(), int)):
            inputs += [K.learning_phase()]
        self.test_function = K.function(inputs, [self.total_loss] + self.metrics_tensors, updates=self.state_updates + self.metrics_updates, name='test_function', **self._function_kwargs)

def _make_predict_function(self):
    if not hasattr(self, 'predict_function'):
        self.predict_function = None
    if self.predict_function is None:
        if self.uses_learning_phase and (not isinstance(K.learning_phase(), int)):
            inputs = self._feed_inputs + [K.learning_phase()]
        else:
            inputs = self._feed_inputs
        kwargs = getattr(self, '_function_kwargs', {})
        self.predict_function = K.function(inputs, self.outputs, updates=self.state_updates, name='predict_function', **kwargs)

def _fit_loop(self, f, ins, out_labels=None, batch_size=None, epochs=100, verbose=1, callbacks=None, val_f=None, val_ins=None, shuffle=True, callback_metrics=None, initial_epoch=0, steps_per_epoch=None, validation_steps=None):
    """Abstract fit function for `f(ins)`.

    Assume that f returns a list, labeled by out_labels.

    # Arguments
        f: Keras function returning a list of tensors
        ins: List of tensors to be fed to `f`
        out_labels: List of strings, display names of
            the outputs of `f`
        batch_size: Integer batch size or None if unknown.
        epochs: Number of times to iterate over the data
        verbose: Verbosity mode, 0, 1 or 2
        callbacks: List of callbacks to be called during training
        val_f: Keras function to call for validation
        val_ins: List of tensors to be fed to `val_f`
        shuffle: Whether to shuffle the data at the beginning of each epoch
        callback_metrics: List of strings, the display names of the metrics
            passed to the callbacks. They should be the
            concatenation of list the display names of the outputs of
             `f` and the list of display names of the outputs of `f_val`.
        initial_epoch: Epoch at which to start training
            (useful for resuming a previous training run)
        steps_per_epoch: Total number of steps (batches of samples)
            before declaring one epoch finished and starting the
            next epoch. Ignored with the default value of `None`.
        validation_steps: Number of steps to run validation for
            (only if doing validation from data tensors).
            Ignored with the default value of `None`.

    # Returns
        `History` object.
    """
    do_validation = False
    if val_f and val_ins:
        do_validation = True
        if verbose and ins and hasattr(ins[0], 'shape') and hasattr(val_ins[0], 'shape'):
            print('Train on %d samples, validate on %d samples' % (ins[0].shape[0], val_ins[0].shape[0]))
    if validation_steps:
        do_validation = True
        if steps_per_epoch is None:
            raise ValueError('Can only use `validation_steps` when doing step-wise training, i.e. `steps_per_epoch` must be set.')
    num_train_samples = self._check_num_samples(ins, batch_size, steps_per_epoch, 'steps_per_epoch')
    if num_train_samples is not None:
        index_array = np.arange(num_train_samples)
    self.history = cbks.History()
    _callbacks = [cbks.BaseLogger(stateful_metrics=self.stateful_metric_names)]
    if verbose:
        if steps_per_epoch is not None:
            count_mode = 'steps'
        else:
            count_mode = 'samples'
        _callbacks.append(cbks.ProgbarLogger(count_mode, stateful_metrics=self.stateful_metric_names))
    _callbacks += (callbacks or []) + [self.history]
    callbacks = cbks.CallbackList(_callbacks)
    out_labels = out_labels or []
    if hasattr(self, 'callback_model') and self.callback_model:
        callback_model = self.callback_model
    else:
        callback_model = self
    callbacks.set_model(callback_model)
    callbacks.set_params({'batch_size': batch_size, 'epochs': epochs, 'steps': steps_per_epoch, 'samples': num_train_samples, 'verbose': verbose, 'do_validation': do_validation, 'metrics': callback_metrics or []})
    callbacks.on_train_begin()
    callback_model.stop_training = False
    for cbk in callbacks:
        cbk.validation_data = val_ins
    feed = self._feed_inputs + self._feed_targets + self._feed_sample_weights
    indices_for_conversion_to_dense = []
    for i in range(len(feed)):
        if issparse(ins[i]) and (not K.is_sparse(feed[i])):
            indices_for_conversion_to_dense.append(i)
    for epoch in range(initial_epoch, epochs):
        for m in self.metrics:
            if isinstance(m, Layer) and m.stateful:
                m.reset_states()
        callbacks.on_epoch_begin(epoch)
        epoch_logs = {}
        if steps_per_epoch is not None:
            for step_index in range(steps_per_epoch):
                batch_logs = {}
                batch_logs['batch'] = step_index
                batch_logs['size'] = 1
                callbacks.on_batch_begin(step_index, batch_logs)
                outs = f(ins)
                if not isinstance(outs, list):
                    outs = [outs]
                for l, o in zip(out_labels, outs):
                    batch_logs[l] = o
                callbacks.on_batch_end(step_index, batch_logs)
                if callback_model.stop_training:
                    break
            if do_validation:
                val_outs = self._test_loop(val_f, val_ins, batch_size=batch_size, steps=validation_steps, verbose=0)
                if not isinstance(val_outs, list):
                    val_outs = [val_outs]
                for l, o in zip(out_labels, val_outs):
                    epoch_logs['val_' + l] = o
        else:
            if shuffle == 'batch':
                index_array = _batch_shuffle(index_array, batch_size)
            elif shuffle:
                np.random.shuffle(index_array)
            batches = _make_batches(num_train_samples, batch_size)
            for batch_index, (batch_start, batch_end) in enumerate(batches):
                batch_ids = index_array[batch_start:batch_end]
                try:
                    if isinstance(ins[-1], float):
                        ins_batch = _slice_arrays(ins[:-1], batch_ids) + [ins[-1]]
                    else:
                        ins_batch = _slice_arrays(ins, batch_ids)
                except TypeError:
                    raise TypeError('TypeError while preparing batch. If using HDF5 input data, pass shuffle="batch".')
                batch_logs = {}
                batch_logs['batch'] = batch_index
                batch_logs['size'] = len(batch_ids)
                callbacks.on_batch_begin(batch_index, batch_logs)
                for i in indices_for_conversion_to_dense:
                    ins_batch[i] = ins_batch[i].toarray()
                outs = f(ins_batch)
                if not isinstance(outs, list):
                    outs = [outs]
                for l, o in zip(out_labels, outs):
                    batch_logs[l] = o
                callbacks.on_batch_end(batch_index, batch_logs)
                if callback_model.stop_training:
                    break
                if batch_index == len(batches) - 1:
                    if do_validation:
                        val_outs = self._test_loop(val_f, val_ins, batch_size=batch_size, verbose=0)
                        if not isinstance(val_outs, list):
                            val_outs = [val_outs]
                        for l, o in zip(out_labels, val_outs):
                            epoch_logs['val_' + l] = o
        callbacks.on_epoch_end(epoch, epoch_logs)
        if callback_model.stop_training:
            break
    callbacks.on_train_end()
    return self.history

def _predict_loop(self, f, ins, batch_size=32, verbose=0, steps=None):
    """Abstract method to loop over some data in batches.

    # Arguments
        f: Keras function returning a list of tensors.
        ins: list of tensors to be fed to `f`.
        batch_size: integer batch size.
        verbose: verbosity mode.
        steps: Total number of steps (batches of samples)
            before declaring `_predict_loop` finished.
            Ignored with the default value of `None`.

    # Returns
        Array of predictions (if the model has a single output)
        or list of arrays of predictions
        (if the model has multiple outputs).
    """
    num_samples = self._check_num_samples(ins, batch_size, steps, 'steps')
    if verbose == 1:
        if steps is not None:
            progbar = Progbar(target=steps)
        else:
            progbar = Progbar(target=num_samples)
    indices_for_conversion_to_dense = []
    for i in range(len(self._feed_inputs)):
        if issparse(ins[i]) and (not K.is_sparse(self._feed_inputs[i])):
            indices_for_conversion_to_dense.append(i)
    if steps is not None:
        unconcatenated_outs = []
        for step in range(steps):
            batch_outs = f(ins)
            if not isinstance(batch_outs, list):
                batch_outs = [batch_outs]
            if step == 0:
                for batch_out in batch_outs:
                    unconcatenated_outs.append([])
            for i, batch_out in enumerate(batch_outs):
                unconcatenated_outs[i].append(batch_out)
            if verbose == 1:
                progbar.update(step + 1)
        if len(unconcatenated_outs) == 1:
            return np.concatenate(unconcatenated_outs[0], axis=0)
        return [np.concatenate(unconcatenated_outs[i], axis=0) for i in range(len(unconcatenated_outs))]
    else:
        outs = []
        batches = _make_batches(num_samples, batch_size)
        index_array = np.arange(num_samples)
        for batch_index, (batch_start, batch_end) in enumerate(batches):
            batch_ids = index_array[batch_start:batch_end]
            if ins and isinstance(ins[-1], float):
                ins_batch = _slice_arrays(ins[:-1], batch_ids) + [ins[-1]]
            else:
                ins_batch = _slice_arrays(ins, batch_ids)
            for i in indices_for_conversion_to_dense:
                ins_batch[i] = ins_batch[i].toarray()
            batch_outs = f(ins_batch)
            if not isinstance(batch_outs, list):
                batch_outs = [batch_outs]
            if batch_index == 0:
                for batch_out in batch_outs:
                    shape = (num_samples,) + batch_out.shape[1:]
                    outs.append(np.zeros(shape, dtype=batch_out.dtype))
            for i, batch_out in enumerate(batch_outs):
                outs[i][batch_start:batch_end] = batch_out
            if verbose == 1:
                progbar.update(batch_end)
        if len(outs) == 1:
            return outs[0]
        return outs

def _test_loop(self, f, ins, batch_size=None, verbose=0, steps=None):
    """Abstract method to loop over some data in batches.

    # Arguments
        f: Keras function returning a list of tensors.
        ins: list of tensors to be fed to `f`.
        batch_size: integer batch size or `None`.
        verbose: verbosity mode.
        steps: Total number of steps (batches of samples)
            before declaring predictions finished.
            Ignored with the default value of `None`.

    # Returns
        Scalar loss (if the model has a single output and no metrics)
        or list of scalars (if the model has multiple outputs
        and/or metrics). The attribute `model.metrics_names` will give you
        the display labels for the scalar outputs.
    """
    if hasattr(self, 'metrics'):
        for m in self.metrics:
            if isinstance(m, Layer) and m.stateful:
                m.reset_states()
        stateful_metric_indices = [i for i, name in enumerate(self.metrics_names) if str(name) in self.stateful_metric_names]
    else:
        stateful_metric_indices = []
    num_samples = self._check_num_samples(ins, batch_size, steps, 'steps')
    outs = []
    if verbose == 1:
        if steps is not None:
            progbar = Progbar(target=steps)
        else:
            progbar = Progbar(target=num_samples)
    feed = self._feed_inputs + self._feed_targets + self._feed_sample_weights
    indices_for_conversion_to_dense = []
    for i in range(len(feed)):
        if issparse(ins[i]) and (not K.is_sparse(feed[i])):
            indices_for_conversion_to_dense.append(i)
    if steps is not None:
        for step in range(steps):
            batch_outs = f(ins)
            if isinstance(batch_outs, list):
                if step == 0:
                    for _ in enumerate(batch_outs):
                        outs.append(0.0)
                for i, batch_out in enumerate(batch_outs):
                    if i in stateful_metric_indices:
                        outs[i] = float(batch_out)
                    else:
                        outs[i] += batch_out
            else:
                if step == 0:
                    outs.append(0.0)
                outs[0] += batch_outs
            if verbose == 1:
                progbar.update(step + 1)
        for i in range(len(outs)):
            if i not in stateful_metric_indices:
                outs[i] /= steps
    else:
        batches = _make_batches(num_samples, batch_size)
        index_array = np.arange(num_samples)
        for batch_index, (batch_start, batch_end) in enumerate(batches):
            batch_ids = index_array[batch_start:batch_end]
            if isinstance(ins[-1], float):
                ins_batch = _slice_arrays(ins[:-1], batch_ids) + [ins[-1]]
            else:
                ins_batch = _slice_arrays(ins, batch_ids)
            for i in indices_for_conversion_to_dense:
                ins_batch[i] = ins_batch[i].toarray()
            batch_outs = f(ins_batch)
            if isinstance(batch_outs, list):
                if batch_index == 0:
                    for batch_out in enumerate(batch_outs):
                        outs.append(0.0)
                for i, batch_out in enumerate(batch_outs):
                    if i in stateful_metric_indices:
                        outs[i] = batch_out
                    else:
                        outs[i] += batch_out * len(batch_ids)
            else:
                if batch_index == 0:
                    outs.append(0.0)
                outs[0] += batch_outs * len(batch_ids)
            if verbose == 1:
                progbar.update(batch_end)
        for i in range(len(outs)):
            if i not in stateful_metric_indices:
                outs[i] /= num_samples
    if len(outs) == 1:
        return outs[0]
    return outs

def _standardize_user_data(self, x, y, sample_weight=None, class_weight=None, check_array_lengths=True, batch_size=None):
    if not hasattr(self, 'optimizer'):
        raise RuntimeError('You must compile a model before training/testing. Use `model.compile(optimizer, loss)`.')
    output_shapes = []
    for output_shape, loss_fn in zip(self._feed_output_shapes, self._feed_loss_fns):
        if loss_fn is losses.sparse_categorical_crossentropy:
            output_shapes.append(output_shape[:-1] + (1,))
        elif not hasattr(loss_fn, '__name__') or getattr(losses, loss_fn.__name__, None) is None:
            output_shapes.append(None)
        else:
            output_shapes.append(output_shape)
    x = _standardize_input_data(x, self._feed_input_names, self._feed_input_shapes, check_batch_axis=False, exception_prefix='input')
    y = _standardize_input_data(y, self._feed_output_names, output_shapes, check_batch_axis=False, exception_prefix='target')
    sample_weights = _standardize_sample_weights(sample_weight, self._feed_output_names)
    class_weights = _standardize_class_weights(class_weight, self._feed_output_names)
    sample_weights = [_standardize_weights(ref, sw, cw, mode) for ref, sw, cw, mode in zip(y, sample_weights, class_weights, self._feed_sample_weight_modes)]
    if check_array_lengths:
        _check_array_lengths(x, y, sample_weights)
    _check_loss_and_target_compatibility(y, self._feed_loss_fns, self._feed_output_shapes)
    if self.stateful and batch_size:
        if x[0].shape[0] % batch_size != 0:
            raise ValueError('In a stateful network, you should only pass inputs with a number of samples that can be divided by the batch size. Found: ' + str(x[0].shape[0]) + ' samples')
    return (x, y, sample_weights)

@interfaces.legacy_generator_methods_support
def predict_generator(self, generator, steps=None, max_queue_size=10, workers=1, use_multiprocessing=False, verbose=0):
    """Generates predictions for the input samples from a data generator.

    The generator should return the same kind of data as accepted by
    `predict_on_batch`.

    # Arguments
        generator: Generator yielding batches of input samples
            or an instance of Sequence (keras.utils.Sequence)
            object in order to avoid duplicate data
            when using multiprocessing.
        steps: Total number of steps (batches of samples)
            to yield from `generator` before stopping.
            Optional for `Sequence`: if unspecified, will use
            the `len(generator)` as a number of steps.
        max_queue_size: Maximum size for the generator queue.
        workers: Integer. Maximum number of processes to spin up
            when using process based threading.
            If unspecified, `workers` will default to 1. If 0, will
            execute the generator on the main thread.
        use_multiprocessing: If `True`, use process based threading.
            Note that because
            this implementation relies on multiprocessing,
            you should not pass
            non picklable arguments to the generator
            as they can't be passed
            easily to children processes.
        verbose: verbosity mode, 0 or 1.

    # Returns
        Numpy array(s) of predictions.

    # Raises
        ValueError: In case the generator yields
            data in an invalid format.
    """
    self._make_predict_function()
    steps_done = 0
    wait_time = 0.01
    all_outs = []
    is_sequence = isinstance(generator, Sequence)
    if not is_sequence and use_multiprocessing and (workers > 1):
        warnings.warn(UserWarning('Using a generator with `use_multiprocessing=True` and multiple workers may duplicate your data. Please consider using the`keras.utils.Sequence class.'))
    if steps is None:
        if is_sequence:
            steps = len(generator)
        else:
            raise ValueError('`steps=None` is only valid for a generator based on the `keras.utils.Sequence` class. Please specify `steps` or use the `keras.utils.Sequence` class.')
    enqueuer = None
    try:
        if workers > 0:
            if is_sequence:
                enqueuer = OrderedEnqueuer(generator, use_multiprocessing=use_multiprocessing)
            else:
                enqueuer = GeneratorEnqueuer(generator, use_multiprocessing=use_multiprocessing, wait_time=wait_time)
            enqueuer.start(workers=workers, max_queue_size=max_queue_size)
            output_generator = enqueuer.get()
        elif is_sequence:
            output_generator = iter(generator)
        else:
            output_generator = generator
        if verbose == 1:
            progbar = Progbar(target=steps)
        while steps_done < steps:
            generator_output = next(output_generator)
            if isinstance(generator_output, tuple):
                if len(generator_output) == 2:
                    x, _ = generator_output
                elif len(generator_output) == 3:
                    x, _, _ = generator_output
                else:
                    raise ValueError('Output of generator should be a tuple `(x, y, sample_weight)` or `(x, y)`. Found: ' + str(generator_output))
            else:
                x = generator_output
            outs = self.predict_on_batch(x)
            if not isinstance(outs, list):
                outs = [outs]
            if not all_outs:
                for out in outs:
                    all_outs.append([])
            for i, out in enumerate(outs):
                all_outs[i].append(out)
            steps_done += 1
            if verbose == 1:
                progbar.update(steps_done)
    finally:
        if enqueuer is not None:
            enqueuer.stop()
    if len(all_outs) == 1:
        if steps_done == 1:
            return all_outs[0][0]
        else:
            return np.concatenate(all_outs[0])
    if steps_done == 1:
        return [out[0] for out in all_outs]
    else:
        return [np.concatenate(out) for out in all_outs]

def handle_metrics(metrics, weights=None):
    metric_name_prefix = 'weighted_' if weights is not None else ''
    for metric in metrics:
        if metric in ('accuracy', 'acc', 'crossentropy', 'ce'):
            output_shape = self._internal_output_shapes[i]
            if output_shape[-1] == 1 or self.loss_functions[i] == losses.binary_crossentropy:
                if metric in ('accuracy', 'acc'):
                    metric_fn = metrics_module.binary_accuracy
                elif metric in ('crossentropy', 'ce'):
                    metric_fn = metrics_module.binary_crossentropy
            elif self.loss_functions[i] == losses.sparse_categorical_crossentropy:
                if metric in ('accuracy', 'acc'):
                    metric_fn = metrics_module.sparse_categorical_accuracy
                elif metric in ('crossentropy', 'ce'):
                    metric_fn = metrics_module.sparse_categorical_crossentropy
            elif metric in ('accuracy', 'acc'):
                metric_fn = metrics_module.categorical_accuracy
            elif metric in ('crossentropy', 'ce'):
                metric_fn = metrics_module.categorical_crossentropy
            if metric in ('accuracy', 'acc'):
                suffix = 'acc'
            elif metric in ('crossentropy', 'ce'):
                suffix = 'ce'
            weighted_metric_fn = _weighted_masked_objective(metric_fn)
            metric_name = metric_name_prefix + suffix
        else:
            metric_fn = metrics_module.get(metric)
            weighted_metric_fn = _weighted_masked_objective(metric_fn)
            if hasattr(metric_fn, 'name'):
                metric_name = metric_fn.name
            else:
                metric_name = metric_fn.__name__
            metric_name = metric_name_prefix + metric_name
        with K.name_scope(metric_name):
            metric_result = weighted_metric_fn(y_true, y_pred, weights=weights, mask=masks[i])
        if len(self.output_names) > 1:
            metric_name = self.output_names[i] + '_' + metric_name
        j = 1
        base_metric_name = metric_name
        while metric_name in self.metrics_names:
            metric_name = base_metric_name + '_' + str(j)
            j += 1
        self.metrics_names.append(metric_name)
        self.metrics_tensors.append(metric_result)
        if isinstance(metric_fn, Layer) and metric_fn.stateful:
            self.stateful_metric_names.append(metric_name)
            self.metrics_updates += metric_fn.updates

def compile(self, optimizer, loss=None, metrics=None, loss_weights=None, sample_weight_mode=None, weighted_metrics=None, target_tensors=None, **kwargs):
    """Configures the model for training.

    # Arguments
        optimizer: String (name of optimizer) or optimizer instance.
            See [optimizers](/optimizers).
        loss: String (name of objective function) or objective function.
            See [losses](/losses).
            If the model has multiple outputs, you can use a different loss
            on each output by passing a dictionary or a list of losses.
            The loss value that will be minimized by the model
            will then be the sum of all individual losses.
        metrics: List of metrics to be evaluated by the model
            during training and testing.
            Typically you will use `metrics=['accuracy']`.
            To specify different metrics for different outputs of a
            multi-output model, you could also pass a dictionary,
            such as `metrics={'output_a': 'accuracy'}`.
        loss_weights: Optional list or dictionary specifying scalar
            coefficients (Python floats) to weight the loss contributions
            of different model outputs.
            The loss value that will be minimized by the model
            will then be the *weighted sum* of all individual losses,
            weighted by the `loss_weights` coefficients.
            If a list, it is expected to have a 1:1 mapping
            to the model's outputs. If a tensor, it is expected to map
            output names (strings) to scalar coefficients.
        sample_weight_mode: If you need to do timestep-wise
            sample weighting (2D weights), set this to `"temporal"`.
            `None` defaults to sample-wise weights (1D).
            If the model has multiple outputs, you can use a different
            `sample_weight_mode` on each output by passing a
            dictionary or a list of modes.
        weighted_metrics: List of metrics to be evaluated and weighted
            by sample_weight or class_weight during training and testing.
        target_tensors: By default, Keras will create placeholders for the
            model's target, which will be fed with the target data during
            training. If instead you would like to use your own
            target tensors (in turn, Keras will not expect external
            Numpy data for these targets at training time), you
            can specify them via the `target_tensors` argument. It can be
            a single tensor (for a single-output model), a list of tensors,
            or a dict mapping output names to target tensors.
        **kwargs: When using the Theano/CNTK backends, these arguments
            are passed into `K.function`.
            When using the TensorFlow backend,
            these arguments are passed into `tf.Session.run`.

    # Raises
        ValueError: In case of invalid arguments for
            `optimizer`, `loss`, `metrics` or `sample_weight_mode`.
    """
    loss = loss or {}
    self.optimizer = optimizers.get(optimizer)
    self.loss = loss
    self.loss_weights = loss_weights
    self.sample_weight_mode = sample_weight_mode
    if isinstance(loss, dict):
        for name in loss:
            if name not in self.output_names:
                raise ValueError('Unknown entry in loss dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
        loss_functions = []
        for name in self.output_names:
            if name not in loss:
                warnings.warn('Output "' + name + '" missing from loss dictionary. We assume this was done on purpose, and we will not be expecting any data to be passed to "' + name + '" during training.', stacklevel=2)
            loss_functions.append(losses.get(loss.get(name)))
    elif isinstance(loss, list):
        if len(loss) != len(self.outputs):
            raise ValueError('When passing a list as loss, it should have one entry per model outputs. The model has ' + str(len(self.outputs)) + ' outputs, but you passed loss=' + str(loss))
        loss_functions = [losses.get(l) for l in loss]
    else:
        loss_function = losses.get(loss)
        loss_functions = [loss_function for _ in range(len(self.outputs))]
    self.loss_functions = loss_functions
    weighted_losses = [_weighted_masked_objective(fn) for fn in loss_functions]
    skip_target_indices = []
    skip_target_weighing_indices = []
    self._feed_outputs = []
    self._feed_output_names = []
    self._feed_output_shapes = []
    self._feed_loss_fns = []
    for i in range(len(weighted_losses)):
        if weighted_losses[i] is None:
            skip_target_indices.append(i)
            skip_target_weighing_indices.append(i)
    masks = self.compute_mask(self.inputs, mask=None)
    if masks is None:
        masks = [None for _ in self.outputs]
    if not isinstance(masks, list):
        masks = [masks]
    if loss_weights is None:
        loss_weights_list = [1.0 for _ in range(len(self.outputs))]
    elif isinstance(loss_weights, dict):
        for name in loss_weights:
            if name not in self.output_names:
                raise ValueError('Unknown entry in loss_weights dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
        loss_weights_list = []
        for name in self.output_names:
            loss_weights_list.append(loss_weights.get(name, 1.0))
    elif isinstance(loss_weights, list):
        if len(loss_weights) != len(self.outputs):
            raise ValueError('When passing a list as loss_weights, it should have one entry per model output. The model has ' + str(len(self.outputs)) + ' outputs, but you passed loss_weights=' + str(loss_weights))
        loss_weights_list = loss_weights
    else:
        raise TypeError('Could not interpret loss_weights argument: ' + str(loss_weights) + ' - expected a list of dicts.')
    self.targets = []
    self._feed_targets = []
    if target_tensors is not None:
        if isinstance(target_tensors, list):
            if len(target_tensors) != len(self.outputs):
                raise ValueError('When passing a list as `target_tensors`, it should have one entry per model output. The model has ' + str(len(self.outputs)) + ' outputs, but you passed target_tensors=' + str(target_tensors))
        elif isinstance(target_tensors, dict):
            for name in target_tensors:
                if name not in self.output_names:
                    raise ValueError('Unknown entry in `target_tensors` dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
            tmp_target_tensors = []
            for name in self.output_names:
                tmp_target_tensors.append(target_tensors.get(name, None))
            target_tensors = tmp_target_tensors
        else:
            raise TypeError('Expected `target_tensors` to be a list or dict, but got:', target_tensors)
    for i in range(len(self.outputs)):
        if i in skip_target_indices:
            self.targets.append(None)
        else:
            shape = self._internal_output_shapes[i]
            name = self.output_names[i]
            if target_tensors is not None:
                target = target_tensors[i]
            else:
                target = None
            if target is None or K.is_placeholder(target):
                if target is None:
                    target = K.placeholder(ndim=len(shape), name=name + '_target', sparse=K.is_sparse(self.outputs[i]), dtype=K.dtype(self.outputs[i]))
                self._feed_targets.append(target)
                self._feed_outputs.append(self.outputs[i])
                self._feed_output_names.append(name)
                self._feed_output_shapes.append(shape)
                self._feed_loss_fns.append(self.loss_functions[i])
            else:
                skip_target_weighing_indices.append(i)
            self.targets.append(target)
    sample_weights = []
    sample_weight_modes = []
    if isinstance(sample_weight_mode, dict):
        for name in sample_weight_mode:
            if name not in self.output_names:
                raise ValueError('Unknown entry in sample_weight_mode dictionary: "' + name + '". Only expected the following keys: ' + str(self.output_names))
        for i, name in enumerate(self.output_names):
            if i in skip_target_weighing_indices:
                weight = None
                sample_weight_modes.append(None)
            else:
                if name not in sample_weight_mode:
                    raise ValueError('Output "' + name + '" missing from sample_weight_modes dictionary')
                if sample_weight_mode.get(name) == 'temporal':
                    weight = K.placeholder(ndim=2, name=name + '_sample_weights')
                    sample_weight_modes.append('temporal')
                else:
                    weight = K.placeholder(ndim=1, name=name + '_sample_weights')
                    sample_weight_modes.append(None)
            sample_weights.append(weight)
    elif isinstance(sample_weight_mode, list):
        if len(sample_weight_mode) != len(self.outputs):
            raise ValueError('When passing a list as sample_weight_mode, it should have one entry per model output. The model has ' + str(len(self.outputs)) + ' outputs, but you passed sample_weight_mode=' + str(sample_weight_mode))
        for i in range(len(self.output_names)):
            if i in skip_target_weighing_indices:
                weight = None
                sample_weight_modes.append(None)
            else:
                mode = sample_weight_mode[i]
                name = self.output_names[i]
                if mode == 'temporal':
                    weight = K.placeholder(ndim=2, name=name + '_sample_weights')
                    sample_weight_modes.append('temporal')
                else:
                    weight = K.placeholder(ndim=1, name=name + '_sample_weights')
                    sample_weight_modes.append(None)
            sample_weights.append(weight)
    else:
        for i, name in enumerate(self.output_names):
            if i in skip_target_weighing_indices:
                sample_weight_modes.append(None)
                sample_weights.append(None)
            elif sample_weight_mode == 'temporal':
                sample_weights.append(K.placeholder(ndim=2, name=name + '_sample_weights'))
                sample_weight_modes.append('temporal')
            else:
                sample_weights.append(K.placeholder(ndim=1, name=name + '_sample_weights'))
                sample_weight_modes.append(None)
    self.sample_weight_modes = sample_weight_modes
    self._feed_sample_weight_modes = []
    for i in range(len(self.outputs)):
        if i not in skip_target_weighing_indices:
            self._feed_sample_weight_modes.append(self.sample_weight_modes[i])
    self.metrics = metrics or []
    self.weighted_metrics = weighted_metrics
    self.metrics_names = ['loss']
    self.metrics_tensors = []
    total_loss = None
    with K.name_scope('loss'):
        for i in range(len(self.outputs)):
            if i in skip_target_indices:
                continue
            y_true = self.targets[i]
            y_pred = self.outputs[i]
            weighted_loss = weighted_losses[i]
            sample_weight = sample_weights[i]
            mask = masks[i]
            loss_weight = loss_weights_list[i]
            with K.name_scope(self.output_names[i] + '_loss'):
                output_loss = weighted_loss(y_true, y_pred, sample_weight, mask)
            if len(self.outputs) > 1:
                self.metrics_tensors.append(output_loss)
                self.metrics_names.append(self.output_names[i] + '_loss')
            if total_loss is None:
                total_loss = loss_weight * output_loss
            else:
                total_loss += loss_weight * output_loss
        if total_loss is None:
            if not self.losses:
                raise ValueError('The model cannot be compiled because it has no loss to optimize.')
            else:
                total_loss = 0.0
        for loss_tensor in self.losses:
            total_loss += loss_tensor
    nested_metrics = _collect_metrics(metrics, self.output_names)
    nested_weighted_metrics = _collect_metrics(weighted_metrics, self.output_names)
    self.metrics_updates = []
    self.stateful_metric_names = []
    with K.name_scope('metrics'):
        for i in range(len(self.outputs)):
            if i in skip_target_indices:
                continue
            y_true = self.targets[i]
            y_pred = self.outputs[i]
            weights = sample_weights[i]
            output_metrics = nested_metrics[i]
            output_weighted_metrics = nested_weighted_metrics[i]

            def handle_metrics(metrics, weights=None):
                metric_name_prefix = 'weighted_' if weights is not None else ''
                for metric in metrics:
                    if metric in ('accuracy', 'acc', 'crossentropy', 'ce'):
                        output_shape = self._internal_output_shapes[i]
                        if output_shape[-1] == 1 or self.loss_functions[i] == losses.binary_crossentropy:
                            if metric in ('accuracy', 'acc'):
                                metric_fn = metrics_module.binary_accuracy
                            elif metric in ('crossentropy', 'ce'):
                                metric_fn = metrics_module.binary_crossentropy
                        elif self.loss_functions[i] == losses.sparse_categorical_crossentropy:
                            if metric in ('accuracy', 'acc'):
                                metric_fn = metrics_module.sparse_categorical_accuracy
                            elif metric in ('crossentropy', 'ce'):
                                metric_fn = metrics_module.sparse_categorical_crossentropy
                        elif metric in ('accuracy', 'acc'):
                            metric_fn = metrics_module.categorical_accuracy
                        elif metric in ('crossentropy', 'ce'):
                            metric_fn = metrics_module.categorical_crossentropy
                        if metric in ('accuracy', 'acc'):
                            suffix = 'acc'
                        elif metric in ('crossentropy', 'ce'):
                            suffix = 'ce'
                        weighted_metric_fn = _weighted_masked_objective(metric_fn)
                        metric_name = metric_name_prefix + suffix
                    else:
                        metric_fn = metrics_module.get(metric)
                        weighted_metric_fn = _weighted_masked_objective(metric_fn)
                        if hasattr(metric_fn, 'name'):
                            metric_name = metric_fn.name
                        else:
                            metric_name = metric_fn.__name__
                        metric_name = metric_name_prefix + metric_name
                    with K.name_scope(metric_name):
                        metric_result = weighted_metric_fn(y_true, y_pred, weights=weights, mask=masks[i])
                    if len(self.output_names) > 1:
                        metric_name = self.output_names[i] + '_' + metric_name
                    j = 1
                    base_metric_name = metric_name
                    while metric_name in self.metrics_names:
                        metric_name = base_metric_name + '_' + str(j)
                        j += 1
                    self.metrics_names.append(metric_name)
                    self.metrics_tensors.append(metric_result)
                    if isinstance(metric_fn, Layer) and metric_fn.stateful:
                        self.stateful_metric_names.append(metric_name)
                        self.metrics_updates += metric_fn.updates
            handle_metrics(output_metrics)
            handle_metrics(output_weighted_metrics, weights=weights)
    self.total_loss = total_loss
    self.sample_weights = sample_weights
    self._feed_sample_weights = []
    for i in range(len(self.sample_weights)):
        if i not in skip_target_weighing_indices:
            self._feed_sample_weights.append(sample_weights[i])
    self._function_kwargs = kwargs
    self.train_function = None
    self.test_function = None
    self.predict_function = None
    trainable_weights = self.trainable_weights
    self._collected_trainable_weights = trainable_weights

def _make_train_function(self):
    if not hasattr(self, 'train_function'):
        raise RuntimeError('You must compile your model before using it.')
    self._check_trainable_weights_consistency()
    if self.train_function is None:
        inputs = self._feed_inputs + self._feed_targets + self._feed_sample_weights
        if self.uses_learning_phase and (not isinstance(K.learning_phase(), int)):
            inputs += [K.learning_phase()]
        with K.name_scope('training'):
            with K.name_scope(self.optimizer.__class__.__name__):
                training_updates = self.optimizer.get_updates(params=self._collected_trainable_weights, loss=self.total_loss)
            updates = self.updates + training_updates + self.metrics_updates
            self.train_function = K.function(inputs, [self.total_loss] + self.metrics_tensors, updates=updates, name='train_function', **self._function_kwargs)

def _make_test_function(self):
    if not hasattr(self, 'test_function'):
        raise RuntimeError('You must compile your model before using it.')
    if self.test_function is None:
        inputs = self._feed_inputs + self._feed_targets + self._feed_sample_weights
        if self.uses_learning_phase and (not isinstance(K.learning_phase(), int)):
            inputs += [K.learning_phase()]
        self.test_function = K.function(inputs, [self.total_loss] + self.metrics_tensors, updates=self.state_updates + self.metrics_updates, name='test_function', **self._function_kwargs)

def _make_predict_function(self):
    if not hasattr(self, 'predict_function'):
        self.predict_function = None
    if self.predict_function is None:
        if self.uses_learning_phase and (not isinstance(K.learning_phase(), int)):
            inputs = self._feed_inputs + [K.learning_phase()]
        else:
            inputs = self._feed_inputs
        kwargs = getattr(self, '_function_kwargs', {})
        self.predict_function = K.function(inputs, self.outputs, updates=self.state_updates, name='predict_function', **kwargs)

def _fit_loop(self, f, ins, out_labels=None, batch_size=None, epochs=100, verbose=1, callbacks=None, val_f=None, val_ins=None, shuffle=True, callback_metrics=None, initial_epoch=0, steps_per_epoch=None, validation_steps=None):
    """Abstract fit function for `f(ins)`.

    Assume that f returns a list, labeled by out_labels.

    # Arguments
        f: Keras function returning a list of tensors
        ins: List of tensors to be fed to `f`
        out_labels: List of strings, display names of
            the outputs of `f`
        batch_size: Integer batch size or None if unknown.
        epochs: Number of times to iterate over the data
        verbose: Verbosity mode, 0, 1 or 2
        callbacks: List of callbacks to be called during training
        val_f: Keras function to call for validation
        val_ins: List of tensors to be fed to `val_f`
        shuffle: Whether to shuffle the data at the beginning of each epoch
        callback_metrics: List of strings, the display names of the metrics
            passed to the callbacks. They should be the
            concatenation of list the display names of the outputs of
             `f` and the list of display names of the outputs of `f_val`.
        initial_epoch: Epoch at which to start training
            (useful for resuming a previous training run)
        steps_per_epoch: Total number of steps (batches of samples)
            before declaring one epoch finished and starting the
            next epoch. Ignored with the default value of `None`.
        validation_steps: Number of steps to run validation for
            (only if doing validation from data tensors).
            Ignored with the default value of `None`.

    # Returns
        `History` object.
    """
    do_validation = False
    if val_f and val_ins:
        do_validation = True
        if verbose and ins and hasattr(ins[0], 'shape') and hasattr(val_ins[0], 'shape'):
            print('Train on %d samples, validate on %d samples' % (ins[0].shape[0], val_ins[0].shape[0]))
    if validation_steps:
        do_validation = True
        if steps_per_epoch is None:
            raise ValueError('Can only use `validation_steps` when doing step-wise training, i.e. `steps_per_epoch` must be set.')
    num_train_samples = self._check_num_samples(ins, batch_size, steps_per_epoch, 'steps_per_epoch')
    if num_train_samples is not None:
        index_array = np.arange(num_train_samples)
    self.history = cbks.History()
    _callbacks = [cbks.BaseLogger(stateful_metrics=self.stateful_metric_names)]
    if verbose:
        if steps_per_epoch is not None:
            count_mode = 'steps'
        else:
            count_mode = 'samples'
        _callbacks.append(cbks.ProgbarLogger(count_mode, stateful_metrics=self.stateful_metric_names))
    _callbacks += (callbacks or []) + [self.history]
    callbacks = cbks.CallbackList(_callbacks)
    out_labels = out_labels or []
    if hasattr(self, 'callback_model') and self.callback_model:
        callback_model = self.callback_model
    else:
        callback_model = self
    callbacks.set_model(callback_model)
    callbacks.set_params({'batch_size': batch_size, 'epochs': epochs, 'steps': steps_per_epoch, 'samples': num_train_samples, 'verbose': verbose, 'do_validation': do_validation, 'metrics': callback_metrics or []})
    callbacks.on_train_begin()
    callback_model.stop_training = False
    for cbk in callbacks:
        cbk.validation_data = val_ins
    feed = self._feed_inputs + self._feed_targets + self._feed_sample_weights
    indices_for_conversion_to_dense = []
    for i in range(len(feed)):
        if issparse(ins[i]) and (not K.is_sparse(feed[i])):
            indices_for_conversion_to_dense.append(i)
    for epoch in range(initial_epoch, epochs):
        for m in self.metrics:
            if isinstance(m, Layer) and m.stateful:
                m.reset_states()
        callbacks.on_epoch_begin(epoch)
        epoch_logs = {}
        if steps_per_epoch is not None:
            for step_index in range(steps_per_epoch):
                batch_logs = {}
                batch_logs['batch'] = step_index
                batch_logs['size'] = 1
                callbacks.on_batch_begin(step_index, batch_logs)
                outs = f(ins)
                if not isinstance(outs, list):
                    outs = [outs]
                for l, o in zip(out_labels, outs):
                    batch_logs[l] = o
                callbacks.on_batch_end(step_index, batch_logs)
                if callback_model.stop_training:
                    break
            if do_validation:
                val_outs = self._test_loop(val_f, val_ins, batch_size=batch_size, steps=validation_steps, verbose=0)
                if not isinstance(val_outs, list):
                    val_outs = [val_outs]
                for l, o in zip(out_labels, val_outs):
                    epoch_logs['val_' + l] = o
        else:
            if shuffle == 'batch':
                index_array = _batch_shuffle(index_array, batch_size)
            elif shuffle:
                np.random.shuffle(index_array)
            batches = _make_batches(num_train_samples, batch_size)
            for batch_index, (batch_start, batch_end) in enumerate(batches):
                batch_ids = index_array[batch_start:batch_end]
                try:
                    if isinstance(ins[-1], float):
                        ins_batch = _slice_arrays(ins[:-1], batch_ids) + [ins[-1]]
                    else:
                        ins_batch = _slice_arrays(ins, batch_ids)
                except TypeError:
                    raise TypeError('TypeError while preparing batch. If using HDF5 input data, pass shuffle="batch".')
                batch_logs = {}
                batch_logs['batch'] = batch_index
                batch_logs['size'] = len(batch_ids)
                callbacks.on_batch_begin(batch_index, batch_logs)
                for i in indices_for_conversion_to_dense:
                    ins_batch[i] = ins_batch[i].toarray()
                outs = f(ins_batch)
                if not isinstance(outs, list):
                    outs = [outs]
                for l, o in zip(out_labels, outs):
                    batch_logs[l] = o
                callbacks.on_batch_end(batch_index, batch_logs)
                if callback_model.stop_training:
                    break
                if batch_index == len(batches) - 1:
                    if do_validation:
                        val_outs = self._test_loop(val_f, val_ins, batch_size=batch_size, verbose=0)
                        if not isinstance(val_outs, list):
                            val_outs = [val_outs]
                        for l, o in zip(out_labels, val_outs):
                            epoch_logs['val_' + l] = o
        callbacks.on_epoch_end(epoch, epoch_logs)
        if callback_model.stop_training:
            break
    callbacks.on_train_end()
    return self.history

def _predict_loop(self, f, ins, batch_size=32, verbose=0, steps=None):
    """Abstract method to loop over some data in batches.

    # Arguments
        f: Keras function returning a list of tensors.
        ins: list of tensors to be fed to `f`.
        batch_size: integer batch size.
        verbose: verbosity mode.
        steps: Total number of steps (batches of samples)
            before declaring `_predict_loop` finished.
            Ignored with the default value of `None`.

    # Returns
        Array of predictions (if the model has a single output)
        or list of arrays of predictions
        (if the model has multiple outputs).
    """
    num_samples = self._check_num_samples(ins, batch_size, steps, 'steps')
    if verbose == 1:
        if steps is not None:
            progbar = Progbar(target=steps)
        else:
            progbar = Progbar(target=num_samples)
    indices_for_conversion_to_dense = []
    for i in range(len(self._feed_inputs)):
        if issparse(ins[i]) and (not K.is_sparse(self._feed_inputs[i])):
            indices_for_conversion_to_dense.append(i)
    if steps is not None:
        unconcatenated_outs = []
        for step in range(steps):
            batch_outs = f(ins)
            if not isinstance(batch_outs, list):
                batch_outs = [batch_outs]
            if step == 0:
                for batch_out in batch_outs:
                    unconcatenated_outs.append([])
            for i, batch_out in enumerate(batch_outs):
                unconcatenated_outs[i].append(batch_out)
            if verbose == 1:
                progbar.update(step + 1)
        if len(unconcatenated_outs) == 1:
            return np.concatenate(unconcatenated_outs[0], axis=0)
        return [np.concatenate(unconcatenated_outs[i], axis=0) for i in range(len(unconcatenated_outs))]
    else:
        outs = []
        batches = _make_batches(num_samples, batch_size)
        index_array = np.arange(num_samples)
        for batch_index, (batch_start, batch_end) in enumerate(batches):
            batch_ids = index_array[batch_start:batch_end]
            if ins and isinstance(ins[-1], float):
                ins_batch = _slice_arrays(ins[:-1], batch_ids) + [ins[-1]]
            else:
                ins_batch = _slice_arrays(ins, batch_ids)
            for i in indices_for_conversion_to_dense:
                ins_batch[i] = ins_batch[i].toarray()
            batch_outs = f(ins_batch)
            if not isinstance(batch_outs, list):
                batch_outs = [batch_outs]
            if batch_index == 0:
                for batch_out in batch_outs:
                    shape = (num_samples,) + batch_out.shape[1:]
                    outs.append(np.zeros(shape, dtype=batch_out.dtype))
            for i, batch_out in enumerate(batch_outs):
                outs[i][batch_start:batch_end] = batch_out
            if verbose == 1:
                progbar.update(batch_end)
        if len(outs) == 1:
            return outs[0]
        return outs

def _test_loop(self, f, ins, batch_size=None, verbose=0, steps=None):
    """Abstract method to loop over some data in batches.

    # Arguments
        f: Keras function returning a list of tensors.
        ins: list of tensors to be fed to `f`.
        batch_size: integer batch size or `None`.
        verbose: verbosity mode.
        steps: Total number of steps (batches of samples)
            before declaring predictions finished.
            Ignored with the default value of `None`.

    # Returns
        Scalar loss (if the model has a single output and no metrics)
        or list of scalars (if the model has multiple outputs
        and/or metrics). The attribute `model.metrics_names` will give you
        the display labels for the scalar outputs.
    """
    if hasattr(self, 'metrics'):
        for m in self.metrics:
            if isinstance(m, Layer) and m.stateful:
                m.reset_states()
        stateful_metric_indices = [i for i, name in enumerate(self.metrics_names) if str(name) in self.stateful_metric_names]
    else:
        stateful_metric_indices = []
    num_samples = self._check_num_samples(ins, batch_size, steps, 'steps')
    outs = []
    if verbose == 1:
        if steps is not None:
            progbar = Progbar(target=steps)
        else:
            progbar = Progbar(target=num_samples)
    feed = self._feed_inputs + self._feed_targets + self._feed_sample_weights
    indices_for_conversion_to_dense = []
    for i in range(len(feed)):
        if issparse(ins[i]) and (not K.is_sparse(feed[i])):
            indices_for_conversion_to_dense.append(i)
    if steps is not None:
        for step in range(steps):
            batch_outs = f(ins)
            if isinstance(batch_outs, list):
                if step == 0:
                    for _ in enumerate(batch_outs):
                        outs.append(0.0)
                for i, batch_out in enumerate(batch_outs):
                    if i in stateful_metric_indices:
                        outs[i] = float(batch_out)
                    else:
                        outs[i] += batch_out
            else:
                if step == 0:
                    outs.append(0.0)
                outs[0] += batch_outs
            if verbose == 1:
                progbar.update(step + 1)
        for i in range(len(outs)):
            if i not in stateful_metric_indices:
                outs[i] /= steps
    else:
        batches = _make_batches(num_samples, batch_size)
        index_array = np.arange(num_samples)
        for batch_index, (batch_start, batch_end) in enumerate(batches):
            batch_ids = index_array[batch_start:batch_end]
            if isinstance(ins[-1], float):
                ins_batch = _slice_arrays(ins[:-1], batch_ids) + [ins[-1]]
            else:
                ins_batch = _slice_arrays(ins, batch_ids)
            for i in indices_for_conversion_to_dense:
                ins_batch[i] = ins_batch[i].toarray()
            batch_outs = f(ins_batch)
            if isinstance(batch_outs, list):
                if batch_index == 0:
                    for batch_out in enumerate(batch_outs):
                        outs.append(0.0)
                for i, batch_out in enumerate(batch_outs):
                    if i in stateful_metric_indices:
                        outs[i] = batch_out
                    else:
                        outs[i] += batch_out * len(batch_ids)
            else:
                if batch_index == 0:
                    outs.append(0.0)
                outs[0] += batch_outs * len(batch_ids)
            if verbose == 1:
                progbar.update(batch_end)
        for i in range(len(outs)):
            if i not in stateful_metric_indices:
                outs[i] /= num_samples
    if len(outs) == 1:
        return outs[0]
    return outs

def _standardize_user_data(self, x, y, sample_weight=None, class_weight=None, check_array_lengths=True, batch_size=None):
    if not hasattr(self, 'optimizer'):
        raise RuntimeError('You must compile a model before training/testing. Use `model.compile(optimizer, loss)`.')
    output_shapes = []
    for output_shape, loss_fn in zip(self._feed_output_shapes, self._feed_loss_fns):
        if loss_fn is losses.sparse_categorical_crossentropy:
            output_shapes.append(output_shape[:-1] + (1,))
        elif not hasattr(loss_fn, '__name__') or getattr(losses, loss_fn.__name__, None) is None:
            output_shapes.append(None)
        else:
            output_shapes.append(output_shape)
    x = _standardize_input_data(x, self._feed_input_names, self._feed_input_shapes, check_batch_axis=False, exception_prefix='input')
    y = _standardize_input_data(y, self._feed_output_names, output_shapes, check_batch_axis=False, exception_prefix='target')
    sample_weights = _standardize_sample_weights(sample_weight, self._feed_output_names)
    class_weights = _standardize_class_weights(class_weight, self._feed_output_names)
    sample_weights = [_standardize_weights(ref, sw, cw, mode) for ref, sw, cw, mode in zip(y, sample_weights, class_weights, self._feed_sample_weight_modes)]
    if check_array_lengths:
        _check_array_lengths(x, y, sample_weights)
    _check_loss_and_target_compatibility(y, self._feed_loss_fns, self._feed_output_shapes)
    if self.stateful and batch_size:
        if x[0].shape[0] % batch_size != 0:
            raise ValueError('In a stateful network, you should only pass inputs with a number of samples that can be divided by the batch size. Found: ' + str(x[0].shape[0]) + ' samples')
    return (x, y, sample_weights)

@interfaces.legacy_generator_methods_support
def predict_generator(self, generator, steps=None, max_queue_size=10, workers=1, use_multiprocessing=False, verbose=0):
    """Generates predictions for the input samples from a data generator.

    The generator should return the same kind of data as accepted by
    `predict_on_batch`.

    # Arguments
        generator: Generator yielding batches of input samples
            or an instance of Sequence (keras.utils.Sequence)
            object in order to avoid duplicate data
            when using multiprocessing.
        steps: Total number of steps (batches of samples)
            to yield from `generator` before stopping.
            Optional for `Sequence`: if unspecified, will use
            the `len(generator)` as a number of steps.
        max_queue_size: Maximum size for the generator queue.
        workers: Integer. Maximum number of processes to spin up
            when using process based threading.
            If unspecified, `workers` will default to 1. If 0, will
            execute the generator on the main thread.
        use_multiprocessing: If `True`, use process based threading.
            Note that because
            this implementation relies on multiprocessing,
            you should not pass
            non picklable arguments to the generator
            as they can't be passed
            easily to children processes.
        verbose: verbosity mode, 0 or 1.

    # Returns
        Numpy array(s) of predictions.

    # Raises
        ValueError: In case the generator yields
            data in an invalid format.
    """
    self._make_predict_function()
    steps_done = 0
    wait_time = 0.01
    all_outs = []
    is_sequence = isinstance(generator, Sequence)
    if not is_sequence and use_multiprocessing and (workers > 1):
        warnings.warn(UserWarning('Using a generator with `use_multiprocessing=True` and multiple workers may duplicate your data. Please consider using the`keras.utils.Sequence class.'))
    if steps is None:
        if is_sequence:
            steps = len(generator)
        else:
            raise ValueError('`steps=None` is only valid for a generator based on the `keras.utils.Sequence` class. Please specify `steps` or use the `keras.utils.Sequence` class.')
    enqueuer = None
    try:
        if workers > 0:
            if is_sequence:
                enqueuer = OrderedEnqueuer(generator, use_multiprocessing=use_multiprocessing)
            else:
                enqueuer = GeneratorEnqueuer(generator, use_multiprocessing=use_multiprocessing, wait_time=wait_time)
            enqueuer.start(workers=workers, max_queue_size=max_queue_size)
            output_generator = enqueuer.get()
        elif is_sequence:
            output_generator = iter(generator)
        else:
            output_generator = generator
        if verbose == 1:
            progbar = Progbar(target=steps)
        while steps_done < steps:
            generator_output = next(output_generator)
            if isinstance(generator_output, tuple):
                if len(generator_output) == 2:
                    x, _ = generator_output
                elif len(generator_output) == 3:
                    x, _, _ = generator_output
                else:
                    raise ValueError('Output of generator should be a tuple `(x, y, sample_weight)` or `(x, y)`. Found: ' + str(generator_output))
            else:
                x = generator_output
            outs = self.predict_on_batch(x)
            if not isinstance(outs, list):
                outs = [outs]
            if not all_outs:
                for out in outs:
                    all_outs.append([])
            for i, out in enumerate(outs):
                all_outs[i].append(out)
            steps_done += 1
            if verbose == 1:
                progbar.update(steps_done)
    finally:
        if enqueuer is not None:
            enqueuer.stop()
    if len(all_outs) == 1:
        if steps_done == 1:
            return all_outs[0][0]
        else:
            return np.concatenate(all_outs[0])
    if steps_done == 1:
        return [out[0] for out in all_outs]
    else:
        return [np.concatenate(out) for out in all_outs]

def handle_metrics(metrics, weights=None):
    metric_name_prefix = 'weighted_' if weights is not None else ''
    for metric in metrics:
        if metric in ('accuracy', 'acc', 'crossentropy', 'ce'):
            output_shape = self._internal_output_shapes[i]
            if output_shape[-1] == 1 or self.loss_functions[i] == losses.binary_crossentropy:
                if metric in ('accuracy', 'acc'):
                    metric_fn = metrics_module.binary_accuracy
                elif metric in ('crossentropy', 'ce'):
                    metric_fn = metrics_module.binary_crossentropy
            elif self.loss_functions[i] == losses.sparse_categorical_crossentropy:
                if metric in ('accuracy', 'acc'):
                    metric_fn = metrics_module.sparse_categorical_accuracy
                elif metric in ('crossentropy', 'ce'):
                    metric_fn = metrics_module.sparse_categorical_crossentropy
            elif metric in ('accuracy', 'acc'):
                metric_fn = metrics_module.categorical_accuracy
            elif metric in ('crossentropy', 'ce'):
                metric_fn = metrics_module.categorical_crossentropy
            if metric in ('accuracy', 'acc'):
                suffix = 'acc'
            elif metric in ('crossentropy', 'ce'):
                suffix = 'ce'
            weighted_metric_fn = _weighted_masked_objective(metric_fn)
            metric_name = metric_name_prefix + suffix
        else:
            metric_fn = metrics_module.get(metric)
            weighted_metric_fn = _weighted_masked_objective(metric_fn)
            if hasattr(metric_fn, 'name'):
                metric_name = metric_fn.name
            else:
                metric_name = metric_fn.__name__
            metric_name = metric_name_prefix + metric_name
        with K.name_scope(metric_name):
            metric_result = weighted_metric_fn(y_true, y_pred, weights=weights, mask=masks[i])
        if len(self.output_names) > 1:
            metric_name = self.output_names[i] + '_' + metric_name
        j = 1
        base_metric_name = metric_name
        while metric_name in self.metrics_names:
            metric_name = base_metric_name + '_' + str(j)
            j += 1
        self.metrics_names.append(metric_name)
        self.metrics_tensors.append(metric_result)
        if isinstance(metric_fn, Layer) and metric_fn.stateful:
            self.stateful_metric_names.append(metric_name)
            self.metrics_updates += metric_fn.updates

